from datetime import datetime
import json
from typing import List, Dict, Any

class User:
    def __init__(self, user_type: str):
        self.user_type = user_type

    def can_upload(self):
        return self.user_type in ['BrokerUser', 'AgencyUser', 'FABSUser']

class Submission:
    def __init__(self, user: User, status: str, data: Dict[str, Any]):
        self.user = user
        self.status = status
        self.data = data
        self.created_at = datetime.now()

    def validate(self):
        # Implement validation logic
        if 'DUNS' in self.data and not self.data['DUNS']:
            return False, "DUNS is required."
        if self.data.get('ActionType') not in ['B', 'C', 'D']:
            return False, "Invalid ActionType."
        return True, "Validation successful."

class FABSFile:
    def __init__(self, file_path: str):
        self.file_path = file_path
        self.errors = []

    def validate_extension(self):
        if not self.file_path.endswith('.csv'):
            self.errors.append("Invalid file format. Please upload a .csv file.")
            return False
        return True

    def read_data(self):
        # Simulating reading the data from the file
        return [{"DUNS": "123456789", "ActionType": "C"}]

class FABSSystem:
    def __init__(self):
        self.submissions = []

    def upload_file(self, user: User, file_path: str):
        if not user.can_upload():
            return "You do not have permission to upload."

        fabs_file = FABSFile(file_path)
        if not fabs_file.validate_extension():
            return fabs_file.errors

        data = fabs_file.read_data()
        for record in data:
            submission = Submission(user, "pending", record)
            is_valid, message = submission.validate()
            if not is_valid:
                return message
            self.submissions.append(submission)

        return "Upload successful."

    def get_submission_status(self) -> List[Dict[str, Any]]:
        return [{"user": sub.user.user_type, "status": sub.status, "data": sub.data, "created_at": sub.created_at} for sub in self.submissions]

    def prevent_duplicate_publish(self, submission: Submission):
        for sub in self.submissions:
            if sub.data == submission.data and sub.status == 'published':
                return "Duplicate submission detected."
        submission.status = 'published'
        return "Submission published successfully."

